import React from 'react'
import CancelIcon from '@material-ui/icons/Cancel';

function DisplayFrame(props) {
    return (props.trigger)?(
        <div className="popup">
            <div className="popup-inner">
                <CancelIcon className="close-btn" onClick={()=>{props.removePopup}}/>
                {/* <h4>NAME: <b><i>{props.user.name}</i></b></h4> */}
                {/* <h4>COUNTRY: <b><i>{props.user.country}</i></b></h4> */}
                {/* <h4>NUMBER: <b><i>{props.user.number}</i></b></h4> */}
            </div>
        </div>
    ): "";
}

export default DisplayFrame
